import React from 'react';
import style from './Main.module.css';
import { Button } from '../Button';

export const Main = () => {

    return(
        <div className={style.main}>
            <div className={style.ourShop}>
                <div className={style.ourInfo}>
                    <p className={style.ourTitle}></p>
                    <p className={style.ourText}></p>
                    <p className={style.ourText}></p>
                    <Button text='Выбрать питомца' fontSize={20}/>
                </div>
                <div className={style.shopPictures}></div>
            </div>
            <div className={style.reasonToChoose}></div>
            <div className={style.dogCategory}></div>
            <div className={style.articles}></div>
        </div>
    )
}
